import { Layout, Menu } from 'antd'
import React, { Component } from 'react';
import {NavLink, Routes, Route} from 'react-router-dom'
import MaleArtistList from './MaleArtistList';

const { Content, Sider } = Layout;

export default class ArtistList extends Component {
    render() {
        return (
            <Layout>
                <Sider style={{width: 250}}>
                    <Menu mode="inline" defaultSelectedKeys="hot">
                        <Menu.Item key="hot">热门歌手</Menu.Item>
                        <Menu.Item key="male">
                            <NavLink to="/artist/cat/0">男歌手</NavLink>
                        </Menu.Item>
                        <Menu.Item key="female">女歌手</Menu.Item>
                        <Menu.Item key="group">组合/乐队</Menu.Item>
                    </Menu>
                </Sider>
                <Content style={{ padding: '0 24px', minHeight: 280 }}>
                    <Routes>
                        <Route path="/artist/cat/0" element={<MaleArtistList />} />
                    </Routes>
                </Content>
            </Layout>
        )
    }
}
